import { AppBar, Toolbar} from '@mui/material';


const NavBar = () => {
    return (
        <AppBar>
            <Toolbar>
                <p>code For Narendra </p>
                <p> All Users</p>
                <p>Add User</p>

            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
